import { Component, OnInit } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { MatIcon } from '@angular/material/icon';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [ RouterOutlet, MatIcon ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})

export class AppComponent implements OnInit {
  ngOnInit() {
  }
}
<div class="grid place-items-center h-screen bg-blue-100">
    <div class="flex gap-1">

        <div class="flex flex-col gap-1">
            @for (i of [7, 6, 5, 4]; track i) {
                <button
                        class="w-[60px] h-[161.4px] hover:scale-[1.03] duration-100 hover:shadow-white hover:shadow bg-[url('/assets/img/bg-container-vertical.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                >{{ i }}</button>
            }
        </div>

        <div class="flex flex-col justify-between">
            <div class="flex gap-1">
                @for (i of [8, 9, 10, 11, 12]; track i) {
                    <button
                            class="w-[161.4px] h-[60px] bg-[url('/assets/img/bg-container.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                    >{{ i }}</button>
                }
            </div>
            <div class="flex gap-1">
                @for (i of [3, 2, 1, 18, 17]; track i) {
                    <button
                            class="w-[161.4px] h-[60px] bg-[url('/assets/img/bg-container.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                    >{{ i }}</button>
                }
            </div>
        </div>

        <div class="flex flex-col gap-1">
            @for (i of [13, 14, 15, 16]; track i) {
                <button
                        class="w-[60px] h-[161.4px] bg-[url('/assets/img/bg-container-vertical.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                >{{ i }}</button>
            }
        </div>

    </div>
</div>
